import React from 'react'
import './App.css'
import fetch from 'node-fetch'

const weater =
  'http://weather.livedoor.com/forecast/webservice/json/v1?city=400040'

export default class App extends React.Component {
  constructor (props) {
    super(props)
    this.state = {}
  }

  handleClick () {
    fetch(
      weater,
      { mode: 'cors' }.then(res => res.json()).then(json => console.log(json))
    )
  }

  render () {
    return (
      <div className='app'>
        <button onClick={this.handleClick}>天気取得</button>
      </div>
    )
  }
}
